import React from "react";
import "../Sub/Sub.scss";

export default function Sub() {
  return (
    <div>
      <form>
        <label>
          <input type="email" name="email" placeholder="email" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}
